import React from 'react';
import { Button, TextField, Paper } from '@mui/material';

export default function OrderForm() {
  return (
    <Paper sx={{ p: 2, mb: 3 }}>
      <TextField label="Stock Symbol" fullWidth sx={{ mb: 2 }} />
      <TextField label="Quantity" type="number" fullWidth sx={{ mb: 2 }} />
      <Button variant="contained" color="primary" onClick={'./components/Orders'}>Place Order</Button>
    </Paper>
  );
}
